import React from 'react';
import Navbar from '../Navbar';
import HeroSection from './HeroSection';
import TeamSection from './TeamSection';
function AboutPage() {
    return ( 
        <>
         <Navbar/>
        <HeroSection/>
        <TeamSection/>
        </>
     );
}

export default AboutPage;
